import React from "react";
import {Button, Image, StyleSheet, Text, View} from 'react-native';
import {globalStyle} from "../styles/style";


export default function Profile({navigation}) {


    return (
        <View style={globalStyle.main}>
            <Text style={styles.full}>Lera</Text>
            <Text style={styles.full}>Kos</Text>
            <Text style={styles.full}>v@gmail.com</Text>
            <Button title={'GoOut'}  onPress={()=> navigation.navigate('Login')}/>

        </View>
    );
}

const styles = StyleSheet.create({
    full:{
        fontFamily:'mt-light',
        fontSize: 16,
        marginTop: 5,
        color:'#474747'
    },
    header:{
        fontSize: 25,
        marginTop: 25
    },
    image: {
        width: '100%',
        height: 200,
    }
});
